import React, { useEffect, useState } from 'react'
import { Slider, Switch, Row, Col } from 'antd'
import './index.css'

export default function SliderSelect() {
  const values = [
    {
      name: '颜色',
      children: [
        {name: 'red'},
        {name: 'blue'},
        {name: 'green'}
      ],
      rulue: {1: '无色', 2: '浅色', 3: '深色'}
    },
    {
      name: '口味',
      children: [
        {name: '咸味'},
        {name: '甜味'},
        {name: '酸味'},
        {name: '辣味'}
      ],
      rulue: {1: '无', 2: '淡', 3: '深', 4: '重'}
    }
  ]
  // useEffect(() => {
  //   values
  // })
  return (
    <div>
      {values.map(item => {
        return (
          <div key={item.name} className='slider-group'>
            <div className='slider-group-title'>
              {item.name}
            </div>
            <div className='slider-group-content'>
              {item.children.map(childrenValue => {
                const marks = item.rulue
                return (
                  <div key={`${item.name}${childrenValue.name}`}>
                    <Row>
                      <Col span={2}>
                        {childrenValue.name}
                      </Col>
                      <Col span={12}>
                        <Slider
                          min={1}
                          max={item.children.length}
                          // onChange={onChange}
                          marks={marks}
                        />
                      </Col>
                    </Row>
                  </div>
                )
              })}
            </div>
          </div>
        )
      })}
    </div>
  )
}
